import React from "react";

const WorldTable = (props) => {
  return (
    <div>
      <h1>World Scores</h1>
      <table>
        {props.worldData.map((data) => {
          return (
            <tbody>
              <tr>
                <td>
                  {data.n}
                  {console.log(data.n)}
                </td>
              </tr>
            </tbody>
          );
        })}
      </table>
    </div>
  );
};

export default WorldTable;
